import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends React.Component{
  constructor(props) {
    super(props);
    this.state = {
      nn: 0
    }
  }

  handleClick(e) {
    this.setState({
      nn: 1
    })
  }

  render () {
    const { nn } = this.state;
    return (
      <div>
        <div>nn</div>
        <button onClick={this.handleClick.bind(this)}>点击我加1</button>
      </div>
    )
  }
}

export default App;
